import styled from "styled-components";
import {mobile} from "./Responsive"

const Container = styled.div`
  height: 30px;
  background-color: teal;
  color:white;
  display:flex;
  align-items:center;
  justify-content:center;
  ${mobile({margin:"0px"})}
`;

const Announce = () => {
  return (
      <Container>
        Free ship over 150 orders!
      </Container>
  )
};

export default Announce;
